import React from 'react';
import styled, {css} from 'styled-components';

const Wrapper = styled.div`
    background-color: = #e3f7f7;
    padding: 10% 0 10% 0;
    `
const BlueBack = (props) =>{
    {props.children}
}

export default BlueBack;
